var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(cast(id as varchar(15)) like '%" + db.encode(searchText) + "%') or " +
        "([codeEpc] like '%" + db.encode(searchText) + "%') or " +
        "([codeQr] like '%" + db.encode(searchText) + "%') or " +  
        "([codeBar] like '%" + db.encode(searchText) + "%') or " + 
        "([prodName] like '%" + db.encode(searchText) + "%') or " +
        "([manufact] like '%" + db.encode(searchText) + "%') or " +
        "([produceDate] like '%" + db.encode(searchText) + "%') or " +  
        "([validDate] like '%" + db.encode(searchText) + "%') or " +
        "([batch] like '%" + db.encode(searchText) + "%') or " +
        "([pack] like '%" + db.encode(searchText) + "%') or " + 
        "([parentEpc] like '%" + db.encode(searchText) + "%') or " +
        "([position] like '%" + db.encode(searchText) + "%') or " +
        "([sn] like '%" + db.encode(searchText) + "%')) ";
}
sql =
    "SELECT count(*) as c " +
    "FROM unionCode " +
    "WHERE ([status] <> 'DEL') " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT *,(case when parentEpc='' then '' else parentEpc end) as parentNode1,'<span style=\"color:blue;\">生命周期</span>' as operation " +
    "FROM unionCode " +
    "WHERE (status <> 'DEL') " + condition +
    "ORDER BY lastAltTime DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"codeEpc,codeQr,prodName,batch,sn,position,pack,parentNode1,operation,id", pageSize*(pageCurrent-1), pageSize);

